      "content": "// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.19;

struct GameData {
    uint256 gameStarted;
    uint256 ante;
    uint256 guess;
    uint256 result;
    address player;
    GameState gameState;
    Winner winner;
}

enum GameState {
    NOT_STARTED,
    GETTING_VRF,
    COMPLETED,
    VOID
}

enum Winner {
    NOT_SET,
    PLAYER,
    HOUSE,
    PUSH
}

contract GameManager {
    bytes32 public constant GAME_MANAGER_ROLE = keccak256("GAME_MANAGER_ROLE");

    uint256 public minimumAnte;
    uint256 public maximumAnte;

    mapping(uint256 => GameData) public gameData;
    mapping(address => uint256) public playerInGame;

    uint256 public gameCounter;
    bool public active;

    event MinimumAnteUpdated(uint256 _minimumAnte);
    event MaximumAnteUpdated(uint256 _maximumAnte);
    event GameEnabled();
    event GameDisabled();

    constructor(uint256 _minimumAnte, uint256 _maximumAnte) {
        minimumAnte = _minimumAnte;
        maximumAnte = _maximumAnte;
        active = true;
    }

    /**
     * @dev this is called inside the start game function inside cups.sol
     * @param _player is the address of the player starting the game
     * @param _ante the amount the player bet
     * @param _guess is the cup number that the player guesses on. 0,1,2
     */
    function _initializeGameData(
        address _player,
        uint256 _ante,
        uint256 _guess
    ) internal {
        require(
            playerInGame[_player] == 0,
            "startGame: player already in game"
        );

        gameCounter++;
        GameData storage g = gameData[gameCounter];
