    "contracts/RPS/RPS.sol": {
      "content": "// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.19;

import "./AccessControlEnumerable.sol";
import "./VRFManager.sol";
import "./GameManager.sol";

/// @title Rock, Paper, Scissors
contract RPS is AccessControlEnumerable, GameManager, VRFManager {
    mapping(uint256 => uint256) public gameByRequestId;


    uint256 public houseBalance;

    event GameCreated(uint256 indexed gameId);
    event PlayerJoined(uint256 indexed gameId);
    event GettingVRF(uint256 indexed gameId);
    event GameCompleted(uint256 indexed gameId);
    event HouseDeposit(uint256 _amount);
    event HouseWithdraw(uint256 _amount);
    event GameVoid(uint256 _gameId);

    constructor(
        address _oracleContract,
        uint256 _minimumAnte,
        uint256 _maximumAnte
    ) GameManager(_minimumAnte, _maximumAnte) VRFManager(_oracleContract) {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        grantRole(
            GAME_MANAGER_ROLE,
            0x012e8326acd4CF9DBBCa78f082a1A1C01ed2192F
        );
        grantRole(
            GAME_MANAGER_ROLE,
            0xa688A477c3cc4835Cb6cba3160391Bd5Ae1D93AA
        );
    }

    /// @param _guess is the cup the caller wants to choose 0: Rock, 1: Paper, 2: Scissors
    function startGame(uint256 _guess) external payable {
        require(active, "startGame: game contract must be active to play");
        require(_guess <= 2, "startGame: guess must be 0, 1, or 2");
        require(
            msg.value <= maximumAnte && msg.value >= minimumAnte,
            "startGame: have to stay within the min and max ante"
        );

        houseBalance -= (msg.value * 95) / 100;

        _initializeGameData(msg.sender, msg.value, _guess);

        emit PlayerJoined(gameCounter);

        _getRandomNumber();
    }

    /// @notice getting random number
    function _getRandomNumber() private {
        gameData[gameCounter].gameState = GameState.GETTING_VRF;

        uint256 requestId = IOracle(VRFOracleContract).requestRandomWords(1);

        gameByRequestId[requestId] = gameCounter;

        emit GettingVRF(gameCounter);
    }

    /**
     * @notice Callback function used by VRF Coordinator
     */
    function fulfillRandomWords(
        uint256 _requestId,
        uint256[] memory _randomWords
    ) internal override {
        uint256 modifiedRandomNumber = (_randomWords[0] % 3);
        _endGame(gameByRequestId[_requestId], modifiedRandomNumber);
    }

    /**
     * @notice ends the game and pays out the player or house
     */
    function _endGame(uint256 _gameId, uint256 _randomNumber) private {
        gameData[gameCounter].gameState = GameState.COMPLETED;

        // Push
        if (gameData[_gameId].guess == _randomNumber) {
            gameData[_gameId].winner = Winner.PUSH;
            // pay player
            require(
                payable(gameData[_gameId].player).send(gameData[_gameId].ante)
            );
            houseBalance += (gameData[_gameId].ante * 95) / 100;
            // player wins
        } else if (gameData[_gameId].guess == (_randomNumber + 1) % 3) {
            gameData[_gameId].winner = Winner.PLAYER;
            //pay player
            require(
                payable(gameData[_gameId].player).send(
                    gameData[_gameId].ante +
                        ((gameData[_gameId].ante * 95) / 100)
                )
            );
            // house wins
        } else {
            gameData[_gameId].winner = Winner.HOUSE;
            // adding to house balance
            houseBalance +=
                gameData[_gameId].ante +
                ((gameData[_gameId].ante * 95) / 100);
        }

        _removePlayerFromGame(gameData[_gameId].player);

        emit GameCompleted(_gameId);
    }

    /// @notice This function deposits to the HOUSE BALANCE.
    /// @dev This will not credit your balance for sender.
    function houseDeposit() external payable {
        houseBalance += msg.value;

        emit HouseDeposit(msg.value);
    }

    /// @notice This function withdraws from the HOUSE BALANCE.
    /// @dev only an account with GAME_MANAGER_ROLE can call this function
    /// @param _amount how many tokens the house would like to withdraw
    function houseWithdraw(
        uint256 _amount
    ) external onlyRole(GAME_MANAGER_ROLE) {
        require(address(this).balance >= _amount, "Insufficient CoinFlip balance.");

        houseBalance -= _amount;

        uint256 communityShare = _amount * 20 / 100;
        uint256 daoShare = _amount * 10 / 100;
        uint256 houseShare = _amount * 70 / 100;

        require(payable(0x4FFB9413fb851B3e6E5F9f442bEb902d7619E371).send(communityShare));
        require(payable(0xe4AfC24B8dba77C4dFBCc9FAB236d0C4701D06fc).send(daoShare));
        require(payable(0x7F19EE3C23F25b4794A25ed25c5418Fb52ff8786).send(houseShare));

        emit HouseWithdraw(_amount);
    }

    /// @notice enables the contract to be used
    /// @dev only an account with GAME_MANAGER_ROLE can call this function
    function toggleOn() external onlyRole(GAME_MANAGER_ROLE) {
        _toggleOn();
    }

    /// @notice pauses the contract from use
    /// @dev only an account with GAME_MANAGER_ROLE can call this function
    function toggleOff() external onlyRole(GAME_MANAGER_ROLE) {
        _toggleOff();
    }

    /// @param _minimumAnte is the mimimum bet you can make for a game
    /// @dev only an account with GAME_MANAGER_ROLE can call this function
    function setMinimumAnte(
        uint256 _minimumAnte
    ) external onlyRole(GAME_MANAGER_ROLE) {
        _setMinimumAnte(_minimumAnte);
    }

    /// @param _maximumAnte is the maximum bet you can make for a game
    /// @dev only an account with GAME_MANAGER_ROLE can call this function
    function setMaximumAnte(
        uint256 _maximumAnte
    ) external onlyRole(GAME_MANAGER_ROLE) {
        _setMaximumAnte(_maximumAnte);
    }

    /// @dev function is for if a player gets stuck in a game
    /// @dev only an account with GAME_MANAGER_ROLE can call this function
    /// @param _player is the address of the player inside the game
    function removePlayerFromGame(
        address _player
    ) external onlyRole(GAME_MANAGER_ROLE) {
        _removePlayerFromGame(_player);
    }

    function voidGame(uint256 _gameId) external onlyRole(GAME_MANAGER_ROLE) {
        require(
            gameData[_gameId].gameState == GameState.GETTING_VRF,
            "voidGame: Wrong state"
        );
        gameData[_gameId].gameState = GameState.VOID;
        address player = gameData[_gameId].player;
        uint256 ante = gameData[_gameId].ante;
        uint256 houseAmount = (ante * 95) / 100;
        _removePlayerFromGame(player);
        houseBalance += houseAmount;
        require(payable(player).send(ante));

        emit GameVoid(_gameId);
    }
}"
